import React, { Children } from 'react';

import { ThemeProvider as ChakraThemeProvider, ColorModeProvider, CSSReset } from '@chakra-ui/react';

import { customTheme } from '../../styles/theme';

const ThemeContext = () => (
    <ChakraThemeProvider theme={customTheme}>
        <ColorModeProvider>
            <CSSReset />
            <Children></Children>
        </ColorModeProvider>
    </ChakraThemeProvider>
);

export { ThemeContext };
